function Movie({ movie }) {
  return (
    <li key={movie.imdbID}>
      <img src={movie.Poster} alt={movie.Title} />
      <h2>Title: {movie.Title}</h2>
      <p>Release Date: {movie.Year}</p>
    </li>
  )
}

export default Movie
